import React from "react";

function CryptoCoin({coin}){
    return (
        <div className="CryptoCoin">
            <svg height="130" width="500">
                <rect width="1080" height="1080" fill="orange" />
                <text fill="#ffffff" fontSize="25" fontFamily="Verdana" x="250" y="40">{coin.name}</text>
                <text fill="#ffffff" fontSize="25" fontFamily="Verdana" x="250" y="40">{coin.current_price}</text>
            </svg>
        </div>
    )
}

export default CryptoCoin;
